import React from 'react';
import ReactDOM from 'react-dom';

const ClassesList = (props) => {
    return (

        <div className="table-wrap">
            <table className="wrapped confluenceTable tablesorter tablesorter-default">
                <thead>
                    <tr className="tablesorter-headerRow">
                        <th>
                            Class Name
                        </th>
                        <th>
                            Location
                        </th>
                        <th>
                            Teacher Name
                        </th>
                        <th>

                        </th>
                        <th>

                        </th>

                    </tr>
                </thead>
                <tbody>
                    {
                        props.clist.map(el => (
                            <tr key={el.clsId}>
                              
                                <td onClick={showStudentData.bind(el.clsId)}>
                                    {el.clsId}
                                </td>
                                <td>
                                    {el.clsLocation}
                                </td>
                                <td>
                                    {el.clsSalutations} {el.clsTLName}
                                </td>
                                <td>
                                    edit
                                </td>
                                <td>
                                    delete
                                </td>
                            </tr>
                        ))

                    }



                </tbody>

            </table>

        </div>


    );

    function showStudentData(id) {
        console.log(id);
    }


}

export default ClassesList;
